import Link from 'next/link';
import Head from 'next/head';

export default function firstPost() {
  return (
    <>
      <Head>
        <title>Custom Title Woohoo!</title>
      </Head>
      <h1>First Post</h1>
      <h2>
        <Link href="/">Back to Home</Link>
      </h2>
    </>
  )
}
